import React from 'react';
import styles from './Hero.module.scss';
import backgroundImage from '../../assets/images/'; // Importe a imagem de background

const Hero = () => {
  return (
    <div className={styles.hero}>
      {/* Imagem de background */}
      <div className={styles.backgroundImage} style={{ backgroundImage: `url(${backgroundImage})` }}>
        {/* Conteúdo sobreposto */}
        <div className={styles.content}>
          <h1>Serras para alto desempenho</h1>
          <p>Conheça nossos produtos e serviços de alta qualidade.</p>
          <div className={styles.buttonContainer}>
            <button className={styles.button}>Nossos produtos</button>
            <button>Fale conosco</button>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Hero;
